import './App.css'
const App = () =>{
    return(
        <div>
            <BrowserRouter>
              <div className='flex relative dark:bg-main-dark-bg'>
                    <div className='fixed right-4 botton-4' style={{zIndex:'1000'}}>
                       <TooltipComponent content='Settings' position ='Top'>
                           <button type='button' className='text-3xl p-3'>
                               <FiSettings/>
                           </button>
                       </TooltipComponent>
                    </div>
              </div>
            </BrowserRouter>
        </div>
    )
}

export default App
